import React, { Component } from 'react';

import { withRouter } from 'react-router-dom';

import "./style.css";
import Header from '../../components/Header';
import Hamburguer from '../../assets/images/hamburguer';
import Drawer from '../../components/SideMenu';

import SideMenuDashboard from './components/SideMenuDashboard';
import PendingTasks from './components/PendingTasks';
import ProfileCard from './components/ProfileCard';
import EvaluationCards from './components/EvaluationCards';
import CalendarCard from './components/CalendarCard';
import LastInfoSection from './components/LastInfoSection';
import Events from './components/Events';

import Students from './components/Students';

class Aluno extends Component {

    openTurma = () => {
        const { history } = this.props;
        history.push("/turma");
    }
    render = () => {
        return (
            <>
                <Header drawer={true} icon={<Hamburguer />} title={"Aluno"}></Header>
                <Drawer></Drawer>
                <div style={{display:"flex", flexDirection:'row'}}>
                    <div >
                        <SideMenuDashboard></SideMenuDashboard>
                    </div>
                    <div style={{display:"flex", flexDirection:'row'}}>
                            <div style={{display:'flex', flexDirection:'column'}}>
                                <div style={{display:'flex', flexDirection:'row'}}>
                                    <div style={{margin:12}}>
                                      <PendingTasks></PendingTasks>
                                    </div>
                                    <div style={{margin:12}}>
                                        <ProfileCard></ProfileCard>
                                    </div>
                                </div>
                                <div style={{display:'flex', flexDirection:'row'}}>
                                    <div style={{margin:12}}>
                                        <EvaluationCards></EvaluationCards>
                                    </div>
                                    <div style={{margin:12}}>
                                        <CalendarCard></CalendarCard>
                                    </div>
                                </div>
                                <div style={{display:'flex', flexDirection:'row'}}>
                                    <LastInfoSection></LastInfoSection>
                                </div>
                            </div>
                            <Events></Events>
                            <Students></Students>
                    </div>
                </div>

            </>
        )
    }

}

export default withRouter(Aluno);
